import React from "react"
import {BrowserRouter, Routes, Route} from "react-router-dom"
import './App.css';
import Signup from "./Signup";

export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/signup" element={<Signup />}></Route>
      </Routes>
    </BrowserRouter>
  );
}
